// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract BEEToken is ERC20, Ownable {

    using SafeMath for uint256;

    uint256 public totalHives;
    uint256 public honeyProducedPerHive = 1; // Quantité de miel produite par ruche (par exemple)
    uint256 public honeyPrice = 1 ether; // Prix du miel en wei (par exemple)

    enum DistributionChoice { Honey, Tokens, Ether }

    struct Hive {
        uint256 id;
        uint256 sharesTotal;
        uint256 sharesSold;
        uint256 honeyBalance;
    }

    mapping(uint256 => Hive) public hives;
    mapping(address => mapping(uint256 => uint256)) public userHiveShares;

    event HiveCreated(uint256 indexed hiveId, uint256 sharesTotal);
    event SharesBought(address indexed buyer, uint256 indexed hiveId, uint256 sharesAmount);
    event HoneyHarvested(uint256 indexed hiveId, uint256 honeyAmount);
    event DistributionReceived(address indexed user, uint256 indexed hiveId, uint256 amount, DistributionChoice choice);

    constructor(uint256 initialSupply) ERC20("BeeToken", "BEE") {
        _mint(msg.sender, initialSupply);
    }

    function mint(address account, uint256 amount) external onlyOwner {
        _mint(account, amount);
    }

    function createHive(uint256 sharesTotal) external onlyOwner {
        totalHives++;
        hives[totalHives] = Hive(totalHives, sharesTotal, 0, 0);
        emit HiveCreated(totalHives, sharesTotal);
    }

    function buyShares(uint256 hiveId, uint256 sharesAmount) external payable {
        require(sharesAmount > 0, "Shares amount must be greater than zero");
        require(hiveId > 0 && hiveId <= totalHives, "Invalid hive ID");
        require(sharesAmount <= hives[hiveId].sharesTotal, "Not enough shares available");
        require(msg.value >= sharesAmount.mul(honeyPrice), "Insufficient payment");

        hives[hiveId].sharesSold = hives[hiveId].sharesSold.add(sharesAmount);
        hives[hiveId].sharesTotal = hives[hiveId].sharesTotal.sub(sharesAmount);
        userHiveShares[msg.sender][hiveId] = userHiveShares[msg.sender][hiveId].add(sharesAmount);

        uint256 honeyAmount = sharesAmount.mul(honeyProducedPerHive);
        hives[hiveId].honeyBalance = hives[hiveId].honeyBalance.add(honeyAmount);

        emit SharesBought(msg.sender, hiveId, sharesAmount);
    }

    function harvestHoney(uint256 hiveId) external onlyOwner {
        require(hiveId > 0 && hiveId <= totalHives, "Invalid hive ID");

        uint256 honeyAmount = hives[hiveId].honeyBalance;
        hives[hiveId].honeyBalance = 0;

        emit HoneyHarvested(hiveId, honeyAmount);
    }

    function receiveDistribution(uint256 hiveId, DistributionChoice choice) external {
        require(userHiveShares[msg.sender][hiveId] > 0, "No shares owned");

        uint256 userShares = userHiveShares[msg.sender][hiveId];
        uint256 amount;

        if (choice == DistributionChoice.Honey) {
            amount = hives[hiveId].honeyBalance.mul(userShares).div(hives[hiveId].sharesSold);
            hives[hiveId].honeyBalance = hives[hiveId].honeyBalance.sub(amount);
            emit DistributionReceived(msg.sender, hiveId, amount, DistributionChoice.Honey);
        } else if (choice == DistributionChoice.Tokens) {
            amount = userShares;
            _transfer(owner(), msg.sender, amount);
            emit DistributionReceived(msg.sender, hiveId, amount, DistributionChoice.Tokens);
        } else if (choice == DistributionChoice.Ether) {
            amount = userShares.mul(honeyPrice);
            payable(msg.sender).transfer(amount);
            emit DistributionReceived(msg.sender, hiveId, amount, DistributionChoice.Ether);
        }

        userHiveShares[msg.sender][hiveId] = 0;
    }
}
